function Team(props) {
	const  slideCards = [
		{
			'full-name': "Алеша попович"
		},
		{	
			'full-name': "Никита Васин"
		},
		{
			'full-name': "Алексей Васькин"
		}
	]

	const sliderConfigs = {
		sliderToShow: 2,
		arrows: true
	}

	return <>
		<Slider {...sliderSettings}>
			slideCards.map((obj, key) => {
				<h1 key={key}>obj["full-name"]</h1>
			})
		</Slider>
		</>

}

export default Team
